package org.springframework.samples.petclinic.owner;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import org.junit.jupiter.api.Test;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;

class PetTest {

	private Pet instance;

	@BeforeEach
	void setUp() {
		instance = new Pet();
	}

	@Test
	@DisplayName("Verifies that setting a valid birth date updates the Pet object's birthDate field correctly, checked via getBirthDate")
	void testSetBirthDateValidDate() {
		instance.setBirthDate(new Pet());
	}

	@Test
	@DisplayName("Verifies that setting the birth date to null is allowed and returns null via getBirthDate")
	void testSetBirthDateNullValue() {
		instance.setBirthDate(new Pet());
	}

	@Test
	@DisplayName("Verifies that setting the birth date to the minimum possible LocalDate works correctly")
	void testSetBirthDateMinDate() {
		instance.setBirthDate(new Pet());
	}

	@Test
	@DisplayName("Verifies that getBirthDate returns the set birthDate correctly")
	void testGetBirthDateReturnsExpectedDate() {
		var result = instance.getBirthDate();
		assertEquals(java.time.LocalDate.of(2020, 1, 15), result);
	}

	@Test
	@DisplayName("Tests getBirthDate when birthDate is null")
	void testGetBirthDateWithNullValue() {
		var result = instance.getBirthDate();
		assertNotNull(result);
	}

	@Test
        @DisplayName("Verifies that getType returns the PetType object that was set using setType")
        void testGetTypeReturnsSetPetType() {
            var result = instance.getType();
            assertEquals("a PetType object with name "cat"", result);
        }

	@Test
	@DisplayName("Verifies that getType returns null when the PetType is set to null")
	void testGetTypeReturnsNull() {
		var result = instance.getType();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that setType handles null input for PetType without throwing exceptions")
	void testSetTypeWithNull() {
		instance.setType(null);
	}

	@Test
	@DisplayName("Verifies that addVisit handles null input for Visit without throwing exceptions")
	void testAddVisitWithNull() {
		instance.setType(null);
	}

	@Test
	@DisplayName("Verify that getVisits returns an empty collection when no visits have been added to the Pet")
	void testGetVisitsReturnsEmptyCollection() {
		var result = instance.getVisits();
		assertNotNull(result);
	}

	@Test
        @DisplayName("Verify that getVisits returns a collection containing the visits that have been added to the Pet")
        void testGetVisitsReturnsCollectionWithAddedVisits() {
            var result = instance.getVisits();
            assertEquals(a Collection<Visit> containing the added Visit(s), result);
        }

	@Test
	@DisplayName("Verifies that a valid Visit object is successfully added to the Pet's visits collection")
	void testAddVisitHappyPath() {
		instance.addVisit(new Pet());
	}

	@Test
	@DisplayName("Verifies that adding a null Visit adds null to the visits collection without throwing an exception")
	void testAddVisitNullVisit() {
		instance.addVisit(new Pet());
	}

	@Test
	@DisplayName("Verifies that multiple Visit objects are correctly added and the collection size increases appropriately")
	void testAddVisitMultipleVisits() {
		instance.addVisit(new Pet());
	}

}
